INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1001, 0, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1, 2, "お！\nあそこに困ってそうな人発見！", "春咲 ひより", 1.4, 0, 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1002, 0, 1, "みんなみたいに\nわたしも強くならなきゃ", 0, 1, 2, "大切な人を\n守れるようになりたい…って", "草野 優衣", 1.4, 0, 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1003, 0, 1, "フェンシングを始めてみては？", 0, 1, 2, "キミに必要な集中力と感性が", "士条 怜", 1.4, 0, 0, 0, "少しは磨かれると思いますよ。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1004, 0, 1, "ねぇ、にいちゃん！", 0, 1, 2, "今日はなにして遊ぶ？", "穂高 みそぎ", 1.5, 0, 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1006, 0, 1, "風宮あかりです", 0, 1, 2, "ねぇ…", "風宮 あかり", 1.4, 0, 0, 0, "私といっしょに…\nいかない？", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1007, 0, 1, "出雲宮子なのー", 0, 1, 2, "プリンたべたいのー", "出雲 宮子", 1.5, 0, 0, 0, "食べ物の恨みは怖いのー", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1008, 0, 1, "ボクは虹村雪。", 0, 1, 2, "キミもボクの美貌に\n吸い寄せられたんだね。", "虹村 雪", 1.4, 0, 0, 0, "いいよ。\n見られることは運命さ…", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1009, 0, 1, "フッ…聞いて後悔するがいい！", 0, 1, 2, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "柊杏奈", 1.4, 0, 0, 0, "人呼んで「疾風の冥姫」!!", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1010, 0, 1, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 1, 2, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "姫宮 真歩", 1.5, 0, 0, 0, "ほんまおおきにやわ～♪", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1011, 0, 1, "衣之咲璃乃です！", 0, 1, 2, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲 璃乃", 1.4, 0, 0, 0, "ここで会ったが\n100年目～！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1012, 0, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1, 2, "ち、超能力って…\n何のことかな～？", "柏崎 初音", 1.4, 0, 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1016, 0, 1, "ちょす！\n美波鈴奈だよ～♪", 0, 1, 2, "一応カリスマ読モJKやってまっす！", "美波 鈴奈", 1.4, 0, 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1017, 0, 1, "はいたーい。\n喜屋武香織さー。", 0, 1, 2, "東京は遊園地みたいなところさー", "喜屋武 香織", 1.4, 0, 0, 0, "でも、沖縄もとってもいいとこさー", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1018, 0, 1, "支倉伊緒です。", 0, 1, 2, "先生って呼ばれるのは\nくすぐったいから", "支倉 伊緒", 1.4, 0, 0, 0, "イオちゃんって呼んでね。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1020, 0, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1, 2, "あ！/\お兄ちゃ～ん\nまってよ～", "茜 ミミ", 1.5, 0, 0, 0, "ミミをおいてかないでぇ～", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1021, 0, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1, 2, "あの……\nふぇ……", "栗林 くるみ", 1.5, 0, 0, 0, "ふぇぇぇぇぇん……", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1022, 0, 1, "風宮よりです。\nあああああ！", 0, 1, 2, "こんな私に貴重な時間を\n割いていただき、", "風宮 より", 1.4, 0, 0, 0, "なんてありがとうございます！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1023, 0, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1, 2, "おにいちゃんどこいくの？\nえ？", "北条 綾音", 1.5, 0, 0, 0, "私こっち行きたいー\nね、早く早くー", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1025, 0, 1, "わっ…わっ…私、\n天野すずめといいます！", 0, 1, 2, "ふ、不束者ですが\nどうぞ末永く…って、", "天野 すずめ", 1.4, 0, 0, 0, "これて何か違う…\nあああすみません！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1027, 0, 1, "……クスクス…私は\n…倉石恵理子……", 0, 1, 2, "あなたは…運命の……\n伴侶……", "倉石 恵理子", 1.4, 0, 0, 0, "離しませんわ………\n絶対に…!!", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1028, 0, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1, 2, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木 咲恋", 1.4, 0, 0, 0, "…そうでしょ？？", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1029, 0, 1, "桜井望だよ！\nよろしくねっ", 0, 1, 2, "ぇっと…\nキミ、私のこと知らないの?!", "桜井 望", 1.4, 0, 0, 0, "あはは、\n私もまだまだだなぁ～", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1030, 0, 1, "デケデケデンっ！", 0, 1, 2, "初めまして、\n私はニノン・ジュベール申すデス！", "ニノン・ジュベール", 1.4, 0, 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1031, 0, 1, "上喜しのぶです。\n手元のドクロが父です。", 0, 1, 2, "でもって私の隣にいるのが……\nえ、見えない？", "上喜 しのぶ", 1.4, 0, 0, 0, "おかしいですね……", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1033, 0, 1, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 1, 2, "けんども\nそれには足りないモンが…", "野戸まひる", 1.5, 0, 0, 0, "そう、\nオラのボケに突っ込める相方が…！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1034, 0, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1, 2, "ちょっと緊張しちゃって…", "綾瀬 ゆかり", 1.4, 0, 0, 0, "ちょ\nちょっと一杯飲んできます…！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1036, 0, 1, "氷川鏡華…です", 0, 1, 2, "知らない人とは話しちゃいけないので", "氷川 鏡華", 1.5, 0, 0, 0, "これ以上お話しすることは…\nないです！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1038, 0, 1, "柏崎…栞です。", 0, 1, 2, "……あ、アラーム。", "柏崎 栞", 1.4, 0, 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1040, 0, 1, "ふ、双葉碧です。", 0, 1, 2, "私、一人も友達がいなくて……", "双葉 碧", 1.4, 0, 0, 0, "野に咲く花が、\n唯一の話相手です。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1042, 0, 1, "三角千歌です。", 0, 1, 2, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角 千歌", 1.4, 0, 0, 0, "そう思っています。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1043, 0, 1, "安芸真琴だ。", 0, 1, 2, "あぁ？\nお前のそいつの仲間か？", "安芸 真琴", 1.4, 0, 0, 0, "う、疑ってすまなかったな…", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1044, 0, 1, "わらわこそは夜を総べる者！", 0, 1, 2, "生けとし生ける全ての者よ！", "イリヤ・オーンスタイン", 1.4, 0, 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1045, 0, 1, "そこで騎士は妖精を乱暴に……", 0, 1, 2, "ぐふふふふ……はっ！", "遠見 空花", 1.4, 0, 0, 0, "ｌク、クウカに何かご用ですか!?", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1046, 0, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1, 2, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまき", 1.4, 0, 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1048, 0, 1, "大神美冬よ！", 0, 1, 2, "それでは早速クエストに…", "大神 美冬", 1.4, 0, 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1049, 0, 1, "星野静流だよ！", 0, 1, 2, "クエストもバトルも\n掃除も洗濯も", "星野静流", 1.4, 0, 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1050, 0, 1, "アタシは玉泉美咲。", 0, 1, 2, "見ての通りの\nセクシー美少女で", "玉泉美咲", 1.5, 0, 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1052, 0, 1, "？？？", 0, 1, 2, "？？？？", "リマ", 1.4, 0, 0, 0, "？？？？", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1053, 0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1, 2, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィント", 1.5, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1058, 0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1, 2, "菓子でつろうなどと\n稚拙な策を……", "ペコリーヌ", 1.5, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1059, 0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1, 2, "菓子でつろうなどと\n稚拙な策を……", "コッコロ", 1.5, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (1060, 0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1, 2, "菓子でつろうなどと\n稚拙な策を……", "キャル", 1.5, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", 1);
